import React from "react";
import {NavLink} from "react-router-dom";
import {Building2, GraduationCap, Home, ListTodo, LogOut, User, Phone} from "lucide-react";

const NavBar = () =>{
    return(
        <div>

            <nav className="bg-black text-white px-6 py-4">
                <div className="max-w-7xl mx-auto flex items-center justify-between">
                    <div className="flex items-center space-x-2">
                        <GraduationCap size={24} className="text-white" />
                        <span className="text-xl font-bold">Uni Earn</span>
                    </div>

                    <div className="flex items-center space-x-8">
                        <NavLink to="/home" icon={<Home size={18} />} text="Home" />
                        <NavLink to="/company" icon={<Building2 size={18} />} text="Company" />
                        <NavLink to="/activities" icon={<User size={18} />} text="Profile" />
                        <NavLink to="/profile" icon={<ListTodo size={18} />} text="Activities" active />
                        <NavLink to="#" icon={<Phone size={18} />} text="Contact" />
                        <NavLink to="#" icon={<LogOut size={18} />} text="Logout" />
                    </div>
                </div>
            </nav>

        </div>
    )
}

export default NavBar;
